import React from "react"; 

const ActiveJournalEntries = (props) => {
    return (
        <div>
            <p>{props.title}</p>
            <p>{props.body}</p>
            <p>{props.conclusion}</p>

        </div>
    )

}

export default ActiveJournalEntries
